DC jacks and plugs have many more standard kinds that are not convertible than domestic AC power plugs and sockets. DC connector size and placement may be selected to avoid incompatible sources and loads from being accidentally connected. Small coaxial connections are used to power portable electronic gadgets from AC adapters, while connectors for automobile accessories and battery packs in portable equipment are also available.

Tired of your guitar amp not getting the job done? We have you covered. With our wide selection of IEC/AC and DC power jacks and plugs, we can power up any product that needs to plug in - with whatever voltage they require! Power leads, speaker cables, DIY cables; if it needs electricity for it to work then consdier choosing from our top quality products.

